Sunny Lane, Alexis Texas, Kristina Rose, Jenna Haze, Bobbi Starr, Shyla Stylez, Rebeca Linares, Gianna


Adult entertainment studio, Elegant Angel, is proud to announce its latest production, &quot;Performers of the Year 2009,&quot; scheduled for release on January 20th. The movie will be a 2-Disc Set, featuring 8 scenes, and starring some of the biggest names of the year: Jenna Haze, Alexis Texas, Gianna, Sunny Lane, Shyla Stylez, Rebeca Linares, Bobbi Starr, and the beautiful 2008 breakout star, Kristina Rose.
